import './index.css';
import SideMenu from './components/SideMenu';
import { BrowserRouter as Router, Switch, Route} from 'react-router-dom';

function App() {
  return (
    <>
      <div></div>
      <Router>
        <SideMenu/>
        <Switch>
          <Route path='/' />
        </Switch>
      </Router>
    </>
  );
}

export default App;
